import React from 'react';
import logo from './logo.svg';
import './App.css';
import PdfParse from './PdfParse';

function App() {
  return (
    <div className="App">
       <PdfParse/>
      <header className="App-header">
       <h1>Upload Your Plans</h1>
      </header>
    </div>
  );
}

export default App;
